import React, { Component } from 'react';
import { Grid, AppBar, Toolbar, Typography } from '@material-ui/core';
import EuroIcon from '@material-ui/icons/Euro';

class Header extends Component {
    state = {  }
    render() { 
        return (
            <AppBar position='static'>
                <Toolbar>
                    <Grid container>
                        <Grid style={{border:'1px solid black'}} item xs='1'>test</Grid>
                        <Grid style={{border:'1px solid black'}} item xs='9'></Grid>
                        <Grid style={{border:'1px solid black'}} item xs='2'></Grid>
                    </Grid>

                    {/*<EuroIcon mr='1' />
                    <Typography variant='h6'>
                        Aji-shop
                    </Typography>*/}
                </Toolbar>
            </AppBar>
        );
    }
}
 
export default Header;
